<script>
let thumbs = 'sm';
window.addEventListener('load', generateObject);
window.addEventListener('resize', generateFinal);
window.addEventListener('contextmenu', toggleThumbnailSize);

function toggleThumbnailSize(event) {
	event.preventDefault();
	switch(thumbs) {
		case 'sm':
			thumbs = 'md';
			generateFinal();
			break;
		case 'md':
			thumbs = 'lg';
			generateFinal();
			break;
		case 'lg':
			thumbs = 'sm';
			generateFinal();
			break;
		default:
			break;
	}
}

function generateObject() {
	let mosaicObject = [];
	let sortedMosaicArray = mosaicArray.sort(function(a,b) {
		return a.localeCompare(b, 'ja');
	});

	let ogImages = document.querySelectorAll('#original img');
	let smImages = document.querySelectorAll('#small img');
	let mdImages = document.querySelectorAll('#medium img');
	let lgImages = document.querySelectorAll('#large img');
	if(ogImages.length == sortedMosaicArray.length &&
	smImages.length == sortedMosaicArray.length)
	{
		for(let i = 0; i < sortedMosaicArray.length; i++)
		{
			mosaicObject.push({
				"filename": sortedMosaicArray[i],
				"sm": smImages[i].title,
				"md": mdImages[i].title,
				"lg": lgImages[i].title,
				"og": ogImages[i].title
			});
		}
		document.getElementById('thumbs').innerHTML = '';
	}
	console.log(mosaicObject);
	generateFinal();
}

function generateFinal() {
	document.getElementById('final').innerHTML = '';
	
	let maxColumns = 3;
	switch(thumbs) {
		case 'lg':
			maxColumns = 1;
			break;
		case 'md':
			maxColumns = 2;
			break;
		case 'sm':
		default:
			break;
	}
	if(window.innerWidth > 960) maxColumns *= 3;
	else if(window.innerWidth > 640) maxColumns *= 2;
	
	let thumbWidth = Math.floor((window.innerWidth - 40) / maxColumns) + 'px';
	let origWidth = Math.floor(window.innerWidth - 40) + 'px';

	for(let item of mosaicArrayOnline)
	{
		let image = document.createElement('img');
		image.alt = item['og'];
		image.src = item[thumbs];
		image.style.width = thumbWidth;
		image.addEventListener('click', function() {
			let original = this.alt;
			this.src = this.alt;
			this.alt = original;
			image.style.width = image.style.width == thumbWidth ? origWidth : thumbWidth;
		});
		document.getElementById('final').appendChild(image);
	}
}
</script>
